import React from 'react';
import FlightItem from '../flight-item';

import './flights-table.css';

const FightsTable = ({ data, update }) => {
  if (!data) { return (<p>Loading...</p>); }

  const users = data.map(({ id, event, time, direction, flight, carrier, vehicle, days }) => {
    return (<FlightItem  
      event={event} 
      time={time} 
      direction={ direction }
      flight={ flight }
      carrier={ carrier }
      vehicle={ vehicle }
      days={ days }
      key={ id } 
    />);
  });

  return (
    <table className="user-list table table-striped">
      <thead>
        <tr>
          <th>Событие</th>
          <th>Время</th>
          <th>Направление</th>
          <th>Рейс</th>
          <th>Перевозчик</th>
          <th>Самолет</th>
          <th>Расписание</th>
        </tr>
      </thead>

      <tbody>
        { users }
      </tbody>
    </table>
  );
};

export default FightsTable;
